(55, 1, '2021-04-22 08:22:25', '2021-04-22 06:22:25', '[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_fullwidth_header title=\"INSPIRE & ASPIRE FOR GREATNESS\" text_orientation=\"center\" header_fullscreen=\"on\" header_scroll_down=\"on\" scroll_down_icon=\"%%2%%\" background_overlay_color=\"rgba(49,96,122,0.38)\" logo_image_url=\"http://localhost/wordpress/wp-content/uploads/2021/04/GREAT_white.png\" _builder_version=\"4.9.4\" _module_preset=\"default\" title_font=\"Raleway|500|||||||\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/aerial-sunset-min.jpg\" text_shadow_style=\"preset5\"][/et_pb_fullwidth_header][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_color=\"#31607A\" top_divider_color=\"#887937\"][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column type=\"4_4\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_accordion icon_color=\"#887937\" _builder_version=\"4.9.4\" _module_preset=\"default\" body_quote_border_weight=\"0px\" border_width_all=\"0px\" border_style_all=\"none\"][et_pb_accordion_item title=\"Vårt recept för greatness\" open=\"on\" open_toggle_text_color=\"#FFFFFF\" _builder_version=\"4.9.4\" _module_preset=\"default\" body_font=\"Raleway||||||||\" body_text_color=\"#FFFFFF\" body_font_size=\"16px\" body_line_height=\"1.8em\" background_color=\"#31607A\" background_enable_color=\"on\" text_orientation=\"center\" border_color_all=\"#887937\" toggle_level=\"h2\" toggle_font=\"Raleway|700||on|||||\" toggle_font_size=\"49px\" toggle_letter_spacing=\"0px\" toggle_line_height=\"1.4em\"]<p style=\"text-align: center;\"><span>Vi kan förse er med konsulter inom allt från förändringsledning, tekniska specialister och digitala strateger till spetskompetens på management-nivå. Vi har även kapacitet att sätta ihop team för större leveranser. Förutom en mångfaldig plattform bestående av egna stjärnkonsulter lägger vi stor vikt i partnerskap och nätverk! Lokala, nationella och internationella. Rätt stjärnor i rätt konstellationer är alltid receptet för att nå greatness.</span></p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_color=\"#1b445a\" width=\"100%\" max_width=\"100%\" custom_margin=\"|||0px|false|false\"][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_image src=\"http://localhost/wordpress/wp-content/uploads/2021/04/business_01-1024x683.jpg\" title_text=\"business_01\" _builder_version=\"4.9.4\" _module_preset=\"default\"][/et_pb_image][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_accordion icon_color=\"#887937\" _builder_version=\"4.9.4\" _module_preset=\"default\" toggle_font_size=\"30px\" custom_margin=\"15%|10%|15%|10%|false|false\" box_shadow_style=\"preset2\"][et_pb_accordion_item title=\"Connected Delivery\" open=\"on\" open_toggle_text_color=\"#FFFFFF\" _builder_version=\"4.9.4\" _module_preset=\"default\" body_font=\"Raleway||||||||\" body_text_color=\"#FFFFFF\" body_font_size=\"16px\" body_line_height=\"1.8em\" background_color=\"#31607A\" background_enable_color=\"on\" text_orientation=\"center\" border_color_all=\"#887937\" box_shadow_style=\"preset2\" toggle_level=\"h3\" toggle_font=\"Raleway|600||on|||||\" toggle_font_size=\"30px\" toggle_letter_spacing=\"0px\" toggle_line_height=\"1.4em\"]<p>Ett ramverk som hanterar allt från konsultbehov till att kunna ansluta sig själv eller bolaget man jobbar på.<br /> Vi kommer inom kort även erbjuda denna tjänsten digital med en plattform, till dess når du oss på<span> </span><a href=\"mailto:info@greatit.se\">info@greatit.se</a><br /> Vill du vara med på Great IT med ett härligt gäng kollegor, få vara med och påverka hur framtiden konsultbolag ska se ut, prioritera, föreslå, engagera eller bara helt enkelt åka med?</p>\n<p>Vi söker hela tiden personer med passion och engagemang, hör av dig!</p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_color=\"#31607A\" custom_padding=\"||||false|false\"][et_pb_row column_structure=\"1_3,1_3,1_3\" use_custom_gutter=\"on\" gutter_width=\"2\" make_equal=\"on\" custom_padding_last_edited=\"on|desktop\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_size=\"contain\" width=\"100%\" max_width=\"100%\" custom_margin_tablet=\"\" custom_margin_phone=\"\" custom_margin_last_edited=\"on|tablet\" custom_padding=\"0px|5%|0px|5%|false|false\" custom_padding_tablet=\"|0%||0%|false|false\" custom_padding_phone=\"\"][et_pb_column type=\"1_3\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/Hex1.png\" background_size=\"contain\" custom_padding=\"||||false|false\" custom_padding_tablet=\"\" custom_padding_phone=\"\" custom_padding_last_edited=\"on|desktop\"][et_pb_blurb title=\"Teknik\" url=\"http://localhost/wordpress/about/#anchor-test-link\" use_icon=\"on\" font_icon=\"%%175%%\" icon_color=\"#FFFFFF\" content_max_width=\"360px\" use_icon_font_size=\"on\" icon_font_size=\"66px\" module_class=\"animation-blurb\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"|||on|||||\" text_orientation=\"center\" background_layout=\"dark\" width=\"100%\" max_width=\"100%\" module_alignment=\"center\" custom_margin_tablet=\"\" custom_margin_phone=\"\" custom_margin_last_edited=\"on|tablet\" custom_padding=\"120px|3%|120px||false|false\" custom_padding_tablet=\"\" custom_padding_phone=\"\" custom_padding_last_edited=\"on|desktop\" link_option_url=\"http://localhost/wordpress/about/#moreInfo\"]<p>BYGGER<br />IMPLEMENTERAR<br />TESTAR<br />AUTOMATISERAR<br />FÖRVALTAR</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/Hex2-1.png\" background_size=\"contain\"][et_pb_blurb title=\"Analytics\" use_icon=\"on\" font_icon=\"%%283%%\" icon_color=\"#FFFFFF\" content_max_width=\"360px\" use_icon_font_size=\"on\" icon_font_size=\"66px\" module_class=\"animation-blurb\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"|||on|||||\" text_orientation=\"center\" background_layout=\"dark\" width=\"100%\" module_alignment=\"center\" custom_padding=\"120px|3%|120px|0%|false|false\" custom_padding_tablet=\"120px|3%|120px|0%|false|false\" custom_padding_phone=\"\" custom_padding_last_edited=\"on|phone\" link_option_url=\"http://localhost/wordpress/about/#moreInfo\" hover_enabled=\"0\" sticky_enabled=\"0\"]<p>DATA ANALYSIS<br />RPA &amp; AI<br />BUSINESS INTELLIGENCE<br />DATA SCIENCE<br />AUTOMATION</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/Hex3-1.png\" background_size=\"contain\"][et_pb_blurb title=\"Webbyrå\" use_icon=\"on\" font_icon=\"%%107%%\" icon_color=\"#FFFFFF\" content_max_width=\"360px\" use_icon_font_size=\"on\" icon_font_size=\"66px\" module_class=\"animation-blurb\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"|||on|||||\" text_orientation=\"center\" background_layout=\"dark\" width=\"100%\" module_alignment=\"center\" custom_padding=\"120px|3%|120px|0%|false|false\" custom_padding_tablet=\"\" custom_padding_phone=\"\" custom_padding_last_edited=\"on|desktop\" link_option_url=\"http://localhost/wordpress/about/#moreInfo\"]<p>WEBBSTRATEGI<br />KONCEPT &amp; DESIGN<br />E-HANDEL<br />HÄLSOKONTROLL<br />DIGITALISERING</p>[/et_pb_blurb][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" use_custom_gutter=\"on