\"center\" max_width=\"710px\" module_alignment=\"center\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"]<h1>vi är great. med det stannar inte där</h1>[/et_pb_text][et_pb_text admin_label=\"Services Section Subtitle\" _builder_version=\"4.9.4\" text_text_color=\"#FFFFFF\" text_font_size=\"16px\" text_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" max_width=\"710px\" module_alignment=\"center\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"]<p class=\"p1\"><span class=\"s1\">Great är, utöver Great IT, vårt väloljade partnernätverk bestående av tusentals toppkonsulter i alla tänkbara discipliner. Vi är tillsammans med våra partners det lilla extra som kan utgöra skillnaden när er digitala miljö ska prestera på full kapacitet. Men det stannar inte där.</span></p>\n<p class=\"p1\"><span class=\"s1\">Great IT tar gärna ett helhetsåtagande inom digital transformation, inom samtliga IT-områden. Genom god personkemi med kompetenta kunder kan vi med hög precision åta oss att vara en heltäckande IT-partner åt er.</span></p>\n<p class=\"p1\"><span class=\"s1\">IT-branschen är i ständig förändring och endast de konsultbolag som är anpassningsbara och framåtsträvande hänger med. Genom samarbeten och omvärldsbevakning är vi på Great IT inte bara Great idag utan även Great imorgon.</span></p>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_3,1_3,1_3\" use_custom_gutter=\"on\" module_id=\"moreInfo\" _builder_version=\"4.9.4\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" width=\"100%\" max_width=\"80%\" custom_padding=\"80px|||\" locked=\"off\"][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"leda it-förändringar\" url=\"#\" use_icon=\"on\" font_icon=\"%%141%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 01\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Vi kan leda dina IT-förändringar!<br /> Med många års erfarenhet från många olika branscher kan vi presentera lösningar och konsulter som kan leda de flesta IT-förändringar säkert.</p>\n<p>Vare sig det rör sig om program- eller projektledare, Agile/Scrum eller stöd för management har vi oftast gjort liknande uppdrag tidigare.</p>\n<p>Vanligtvis utförs uppdragen i form av en kompetent konsult i din organisation, men vi tar även åtaganden för att nå en effekt av den förändring som ska utföras.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"digital närvaro\" url=\"#\" use_icon=\"on\" font_icon=\"%%101%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 02\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Vi har en unik tjänsteportfölj bestående av både bred och djup kunskap i hur man bäst skapar och vidareutvecklar ett företags digitala närvaro. <span>Vi erbjuder spetskompetens inom bland annat strategi, webb, e-handel, UX/BX till såväl små som stora företag i Sverige.</span></p>\n<p>Vi är oberoende, kompetenta och mycket erfarna inom flertalet branscher. Vi erbjuder skräddarsydda, kraftfulla och effektiva paketeringar som ger förutsättning för långa samarbeten och goda kundrelationer.</p>\n<p>Våra samarbeten ska i största mån reflektera affärsnytta för kunden.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"tekniska specialister\" url=\"#\" use_icon=\"on\" font_icon=\"%%158%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 03\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p><span>Vi älskar att ta hand om tekniken! Våra tjänster och konsulter sträcker sig inom många områden, bland annat inom cloud- och IT-infrastruktur. Era tekniska lösningar ska ge den effekt som önskas, genom vårt stöd i förvaltningen eller förändringen.</span></p>\n<p><span>Vi har stöttat flera chefer och beslutsfattare inom IT med vår tekniska kompetens, IT-arkitektur, strategiska val och taktisk planering i befintliga samt nya teknologier och trender.<br /></span></p>\n<p><span>Vanliga uppdrag innefattar bland annat DevOps och continous improvement, microservices, RPA, AI och datadriven services.</span></p>[/et_pb_blurb][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Cloud\" use_icon=\"on\" font_icon=\"%%97%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Ledning\" use_icon=\"on\" font_icon=\"%%258%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Our Team\" _builder_version=\"3.22\" custom_pad