 i partnerskap och nätverk! Lokala, nationella och internationella. Rätt stjärnor i rätt konstellationer är alltid receptet för att nå greatness.</span></p>[/et_pb_accordion_item][/et_pb_accordion][et_pb_accordion icon_color=\"#887937\" _builder_version=\"4.9.4\" _module_preset=\"default\" toggle_font_size=\"30px\" box_shadow_style=\"preset2\"][et_pb_accordion_item title=\"Connected Delivery\" open=\"on\" open_toggle_text_color=\"#FFFFFF\" _builder_version=\"4.9.4\" _module_preset=\"default\" body_font=\"Raleway||||||||\" body_text_color=\"#FFFFFF\" body_font_size=\"16px\" body_line_height=\"1.8em\" background_color=\"#31607A\" background_enable_color=\"on\" text_orientation=\"center\" border_color_all=\"#887937\" box_shadow_style=\"preset2\" toggle_level=\"h3\" toggle_font=\"Raleway|600||on|||||\" toggle_font_size=\"30px\" toggle_letter_spacing=\"0px\" toggle_line_height=\"1.4em\"]<p>Ett ramverk som hanterar allt från konsultbehov till att kunna ansluta sig själv eller bolaget man jobbar på.<br /> Vi kommer inom kort även erbjuda denna tjänsten digital med en plattform, till dess når du oss på<span> </span><a href=\"mailto:info@greatit.se\">info@greatit.se</a><br /> Vill du vara med på Great IT med ett härligt gäng kollegor, få vara med och påverka hur framtiden konsultbolag ska se ut, prioritera, föreslå, engagera eller bara helt enkelt åka med?</p>\n<p>Vi söker hela tiden personer med passion och engagemang, hör av dig!</p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_color=\"#31607A\"][et_pb_row column_structure=\"1_3,1_3,1_3\" use_custom_gutter=\"on\" gutter_width=\"2\" make_equal=\"on\" custom_padding_last_edited=\"on|tablet\" _builder_version=\"4.9.4\" _module_preset=\"default\" width=\"100%\" max_width=\"100%\" custom_padding=\"0px|10%|0px|10%|false|false\" custom_padding_tablet=\"|0%||0%|false|false\" custom_padding_phone=\"\"