(95, 1, '2021-04-22 14:34:31', '2021-04-22 12:34:31', '[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_fullwidth_header title=\"INSPIRE & ASPIRE FOR GREATNESS\" text_orientation=\"center\" header_fullscreen=\"on\" header_scroll_down=\"on\" scroll_down_icon=\"%%2%%\" background_overlay_color=\"rgba(49,96,122,0.38)\" logo_image_url=\"http://localhost/wordpress/wp-content/uploads/2021/04/GREAT_white.png\" _builder_version=\"4.9.4\" _module_preset=\"default\" title_font=\"Raleway|500|||||||\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/aerial-sunset-min.jpg\" hover_enabled=\"0\" text_shadow_style=\"preset5\" sticky_enabled=\"0\"][/et_pb_fullwidth_header][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"4.9.4\" _module_preset=\"default\" background_color=\"#1b445a\" hover_enabled=\"0\" sticky_enabled=\"0\"][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"4_4\"][et_pb_accordion _builder_version=\"4.9.4\" _module_preset=\"default\" icon_color=\"#887937\" box_shadow_style=\"preset2\" hover_enabled=\"0\" sticky_enabled=\"0\"][et_pb_accordion_item title=\"Vårt recept för greatness\" _builder_version=\"4.9.4\" _module_preset=\"default\" open=\"on\" text_orientation=\"center\" open_toggle_text_color=\"#FFFFFF\" background_color=\"#31607A\" background_enable_color=\"on\" box_shadow_style=\"preset2\" body_text_color=\"#FFFFFF\" toggle_level=\"h2\" toggle_font=\"Raleway|700||on|||||\" toggle_font_size=\"49px\" toggle_letter_spacing=\"0px\" toggle_line_height=\"1.4em\" body_font=\"Raleway||||||||\" body_font_size=\"16px\" body_line_height=\"1.8em\" border_color_all=\"#887937\" hover_enabled=\"0\" sticky_enabled=\"0\"]<p style=\"text-align: center;\"><span>Vi kan förse er med konsulter inom allt från förändringsledning, tekniska specialister och digitala strateger till spetskompetens på management-nivå. Vi har även kapacitet att sätta ihop team för större leveranser. Förutom en mångfaldig plattform bestående av egna stjärnkonsulter lägger vi stor vikt i partnerskap och nätverk! Lokala, nationella och internationella. Rätt stjärnor i rätt konstellationer är alltid receptet för att nå greatness.</span></p>[/et_pb_accordion_item][et_pb_accordion_item title=\"Connected Delivery\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\"]<p>Ett ramverk som hanterar allt från konsultbehov till att kunna ansluta sig själv eller bolaget man jobbar på.<br />Vi kommer inom kort även erbjuda denna tjänsten digital med en plattform, till dess når du oss på<span> </span><a href=\"mailto:info@greatit.se\">info@greatit.se</a><br />Vill du vara med på Great IT med ett härligt gäng kollegor, få vara med och påverka hur framtiden konsultbolag ska se ut, prioritera, föreslå, engagera eller bara helt enkelt åka med?</p>\n<p>Vi söker hela tiden personer med passion och engagemang, hör av dig!</p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"4_4\"][et_pb_accordion _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\"][et_pb_accordion_item title=\"Your Title Goes Here\" _builder_version=\"4.9.4\" _module_preset=\"default\" open=\"on\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"Your Title Goes Here\" _builder_version=\"4.9.4\" _module_preset=\"default\" open=\"off\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section]', 'Hem', '', 'inherit', 'closed', 'closed', '', '55-revision-v1', '', '', '2021-04-22 14:34:31', '2021-04-22 12:34:31', '', 55, 'http://localhost/wordpress/?p=95', 0, 'revision', '', 0),
