r. Excepteur sint occaecat cupidatat non proident sunt in culpa.</p>\r[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\" column_structure=\"1_2,1_2\"][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"1_2\"][et_pb_blurb title=\"Uffe Servin\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\" header_font=\"Raleway|700|||||||\" header_level=\"h3\" body_font=\"Raleway||||||||\" body_font_size=\"16px\" custom_padding=\"0px|||||\" custom_margin=\"100px||40px||false|false\"]<p><span>Jag är Uffe Servin, en entreprenör i hjärtat. I tio år har jag kombinerat mitt arbete som kravställare och utförare inom IT-branschen med att driva enskilda verksamheter inom tech. Leverera kvalitet i en nyskapande anda beskriver mitt sätt att arbeta mot kund.</span></p>[/et_pb_blurb][/et_pb_column][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"1_2\"][et_pb_image src=\"http://localhost/wordpress/wp-content/uploads/2021/04/uffe.jpg\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\" title_text=\"uffe\"][/et_pb_image][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\" column_structure=\"1_2,1_2\"][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"1_2\"][et_pb_image src=\"data:image/svg+xml;base64,\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\"][/et_pb_image][/et_pb_column][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"1_2\"][et_pb_blurb title=\"Your Title Goes Here\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\" column_structure=\"1_2,1_2\"][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"1_2\"][et_pb_blurb title=\"Your Title Goes Here\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][et_pb_column _builder_version=\"4.9.4\" _module_preset=\"default\" type=\"1_2\"][et_pb_image src=\"data:image/svg+xml;base64,\" _builder_version=\"4.9.4\" _module_preset=\"default\" hover_enabled=\"0\" sticky_enabled=\"0\"][/et_pb_image][/et_pb_column][/et_pb_row][et_pb_row use_custom_gutter=\"on\" gutter_width=\"2\" _builder_version=\"3.25\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" custom_padding=\"44px|0px|27px|0px\" column_structure=\"1_3,1_3,1_3\"][et_pb_column type=\"1_3\" _builder_version=\"3.25\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_team_member name=\"Ethan Rothell\" position=\"CEO\" image_url=\"http://localhost/wordpress/wp-content/uploads/2021/04/travel-portrait-07.jpg\" facebook_url=\"#\" twitter_url=\"#\" google_url=\"#\" linkedin_url=\"#\" admin_label=\"Member 01\" _builder_version=\"3.0.78\" header_font=\"Montserrat||||\" header_text_color=\"#1f1f1f\" header_font_size=\"22px\" header_line_height=\"2em\" body_text_align=\"center\" body_text_color=\"#666666\" body_font_size=\"16px\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" custom_padding=\"|||\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"][/et_pb_team_membe