(234853, 1, '2021-04-26 10:58:20', '2021-04-26 08:58:20', '[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_fullwidth_header title=\"Om oss\" subhead=\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque nisl eros, \rpulvinar facilisis justo mollis, auctor consequat urna.\" text_orientation=\"center\" header_fullscreen=\"on\" header_scroll_down=\"on\" scroll_down_icon=\"%%2%%\" scroll_down_icon_color=\"#FFFFFF\" background_overlay_color=\"rgba(27,68,90,0.46)\" _builder_version=\"4.9.4\" _module_preset=\"default\" title_font=\"Raleway|700|||||||\" title_font_size=\"60px\" content_font=\"Raleway|300|||||||\" subhead_font=\"Raleway||||||||\" subhead_font_size=\"20px\" background_enable_color=\"off\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/ola-uffe-1.jpg\" text_shadow_style=\"preset1\"][/et_pb_fullwidth_header][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Services\" _builder_version=\"4.9.4\" background_color=\"#31607a\" custom_padding=\"90px||90px|\" locked=\"off\"][et_pb_row _builder_version=\"3.25\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" custom_width_px=\"710px\"][et_pb_column type=\"4_4\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_divider color=\"#887937\" divider_weight=\"3px\" disabled_on=\"off|off|off\" _builder_version=\"4.9.4\" background_color_gradient_direction=\"90deg\" max_width=\"100px\" module_alignment=\"center\" height=\"5px\" custom_margin=\"||20px|\" custom_padding=\"||20px|\" animation_style=\"slide\" animation_direction=\"bottom\" saved_tabs=\"all\" locked=\"off\"][/et_pb_divider][et_pb_text admin_label=\"Services Section Title\" _builder_version=\"4.9.4\" text_font=\"|||on|||||\" text_text_color=\"#FFFFFF\" header_font=\"Raleway||||||||\" header_text_color=\"#FFFFFF\" header_font_size=\"36px\" text_orientation=\"center\" max_width=\"710px\" module_alignment=\"center\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"]<h1>vi är great. med det stannar inte där</h1>[/et_pb_text][et_pb_text admin_label=\"Services Section Subtitle\" _builder_version=\"4.9.4\" text_text_color=\"#FFFFFF\" text_font_size=\"16px\" text_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" max_width=\"710px\" module_alignment=\"center\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"]<p class=\"p1\"><span class=\"s1\">Great är, utöver Great IT, vårt väloljade partnernätverk bestående av tusentals toppkonsulter i alla tänkbara discipliner. Vi är tillsammans med våra partners det lilla extra som kan utgöra skillnaden när er digitala miljö ska prestera på full kapacitet. Men det stannar inte där.</span></p>\n<p class=\"p1\"><span class=\"s1\">Great IT tar gärna ett helhetsåtagande inom digital transformation, inom samtliga IT-områden. Genom god personkemi med kompetenta kunder kan vi med hög precision åta oss att vara en heltäckande IT-partner åt er.</span></p>\n<p class=\"p1\"><span class=\"s1\">IT-branschen är i ständig förändring och endast de konsultbolag som är anpassningsbara och framåtsträvande hänger med. Genom samarbeten och omvärldsbevakning är vi på Great IT inte bara Great idag utan även Great imorgon.</span></p>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_3,1_3,1_3\" use_custom_gutter=\"on\" _builder_version=\"4.9.4\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" width=\"100%\" max_width=\"80%\" custom_padding=\"80px|||\" locked=\"off\"][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"leda it-förändringar\" url=\"#\" use_icon=\"on\" font_icon=\"%%141%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 01\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Vi kan leda dina IT-förändringar!<br /> Med många års erfarenhet från många olika branscher kan vi presentera lösningar och konsulter som kan leda de flesta IT-förändringar säkert.</p>\n<p>Vare sig det rör sig om program- eller projektledare, Agile/Scrum eller stöd för management har vi oftast gjort liknande uppdrag tidigare.</p>\n<p>Vanligtvis utförs uppdragen i form av en kompetent konsult i din organisation, men vi tar även åtaganden för att nå en effekt av den förändring som ska utföras.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"digital närvaro\" url=\"#\" use_icon=\"on\" font_icon=\"%%101%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 02\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Vi har en unik tjänsteportfölj bestående av både bred och djup kunskap i hur man bäst skapar och vidareutvecklar ett företags digitala närvaro. <span>Vi erbjuder spetskompetens inom bland annat strategi, webb, e-handel, UX/BX till såväl små som stora företag i Sverige.</span></p>\n<p>Vi är oberoende, kompetenta och mycket erfarna inom flertalet branscher. Vi erbjuder skräddarsydda, kraftfulla och effektiva paketeringar som ger förutsättning för långa samarbeten och goda kundrelationer.</p>\n<p>Våra samarbeten ska i största mån reflektera affärsnytta för kunden.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"tekniska specialister\" url=\"#\" use_icon=\"on\" font_icon=\"%%158%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 03\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p><span>Vi älskar att ta hand om tekniken! Våra tjänster och konsulter sträcker sig inom många områden, bland annat inom cloud- och IT-infrastruktur. Era tekniska lösningar ska ge den effekt som önskas, genom vårt stöd i förvaltningen eller förändringen.</span></p>\n<p><span>Vi har stöttat flera chefer och beslutsfattare inom IT med vår tekniska kompetens, IT-arkitektur, strategiska val och taktisk planering i befintliga samt nya teknologier och trender.<br /></span></p>\n<p><span>Vanliga uppdrag innefattar bland annat DevOps och continous improvement, microservices, RPA, AI och datadriven services.</span></p>[/et_pb_blurb][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.9.4\" _module_preset=\"default\" column_structure=\"1_2,1_2\"][et_pb_column _builder_version=\"4.9.4\" _module_