er_font=\"Raleway|700|||||||\" body_font=\"Raleway||||||||\" body_font_size=\"16px\" custom_margin=\"100px||40px||false|false\" custom_padding=\"0px|||||\"]<p><span>Jag är Uffe Servin, en entreprenör i hjärtat. I tio år har jag kombinerat mitt arbete som kravställare och utförare inom IT-branschen med att driva enskilda verksamheter inom tech. Leverera kvalitet i en nyskapande anda beskriver mitt sätt att arbeta mot kund.</span></p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_image src=\"http://localhost/wordpress/wp-content/uploads/2021/04/uffe.jpg\" title_text=\"uffe\" _builder_version=\"4.9.4\" _module_preset=\"default\"][/et_pb_image][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_image src=\"data:image/svg+xml;base64,\" _builder_version=\"4.9.4\" _module_preset=\"default\"][/et_pb_image][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Your Title Goes Here\" _builder_version=\"4.9.4\" _module_preset=\"default\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Your Title Goes Here\" _builder_version=\"4.9.4\" _module_preset=\"default\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this tex