.4\" _module_preset=\"default\"][et_pb_blurb title=\"Cloud\" use_icon=\"on\" font_icon=\"%%97%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Ledning\" use_icon=\"on\" font_icon=\"%%258%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Our Team\" _builder_version=\"3.22\" custom_padding=\"90px||90px|\