(234887, 1, '2021-04-26 15:16:02', '2021-04-26 13:16:02', '[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_fullwidth_header title=\"Om oss\" subhead=\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque nisl eros, \rpulvinar facilisis justo mollis, auctor consequat urna.\" text_orientation=\"center\" header_fullscreen=\"on\" header_scroll_down=\"on\" scroll_down_icon=\"%%2%%\" scroll_down_icon_color=\"#FFFFFF\" background_overlay_color=\"rgba(27,68,90,0.46)\" _builder_version=\"4.9.4\" _module_preset=\"default\" title_font=\"Raleway|700|||||||\" title_font_size=\"60px\" content_font=\"Raleway|300|||||||\" subhead_font=\"Raleway||||||||\" subhead_font_size=\"20px\" background_enable_color=\"off\" background_image=\"http://localhost/wordpress/wp-content/uploads/2021/04/ola-uffe-1.jpg\" text_shadow_style=\"preset1\"][/et_pb_fullwidth_header][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Services\" _builder_version=\"4.9.4\" background_color=\"#31607a\" custom_padding=\"90px||90px|\" locked=\"off\"][et_pb_row _builder_version=\"3.25\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" custom_width_px=\"710px\"][et_pb_column type=\"4_4\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_divider color=\"#887937\" divider_weight=\"3px\" disabled_on=\"off|off|off\" _builder_version=\"4.9.4\" background_color_gradient_direction=\"90deg\" max_width=\"100px\" module_alignment=\"center\" height=\"5px\" custom_margin=\"||20px|\" custom_padding=\"||20px|\" animation_style=\"slide\" animation_direction=\"bottom\" saved_tabs=\"all\" locked=\"off\"][/et_pb_divider][et_pb_text admin_label=\"Services Section Title\" _builder_version=\"4.9.4\" text_font=\"|||on|||||\" text_text_color=\"#FFFFFF\" header_font=\"Raleway||||||||\" header_text_color=\"#FFFFFF\" header_font_size=\"36px\" text_orientation=\"center\" max_width=\"710px\" module_alignment=\"center\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"]<h1>vi är great. med det stannar inte där</h1>[/et_pb_text][et_pb_text admin_label=\"Services Section Subtitle\" _builder_version=\"4.9.4\" text_text_color=\"#FFFFFF\" text_font_size=\"16px\" text_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" max_width=\"710px\" module_alignment=\"center\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"20%\"]<p class=\"p1\"><span class=\"s1\">Great är, utöver Great IT, vårt väloljade partnernätverk bestående av tusentals toppkonsulter i alla tänkbara discipliner. Vi är tillsammans med våra partners det lilla extra som kan utgöra skillnaden när er digitala miljö ska prestera på full kapacitet. Men det stannar inte där.</span></p>\n<p class=\"p1\"><span class=\"s1\">Great IT tar gärna ett helhetsåtagande inom digital transformation, inom samtliga IT-områden. Genom god personkemi med kompetenta kunder kan vi med hög precision åta oss att vara en heltäckande IT-partner åt er.</span></p>\n<p class=\"p1\"><span class=\"s1\">IT-branschen är i ständig förändring och endast de konsultbolag som är anpassningsbara och framåtsträvande hänger med. Genom samarbeten och omvärldsbevakning är vi på Great IT inte bara Great idag utan även Great imorgon.</span></p>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_3,1_3,1_3\" use_custom_gutter=\"on\" module_id=\"moreInfo\" _builder_version=\"4.9.4\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" width=\"100%\" max_width=\"80%\" custom_padding=\"80px|||\" locked=\"off\"][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"leda it-förändringar\" url=\"#\" use