reutvecklar ett företags digitala närvaro. <span>Vi erbjuder spetskompetens inom bland annat strategi, webb, e-handel, UX/BX till såväl små som stora företag i Sverige.</span></p>\n<p>Vi är oberoende, kompetenta och mycket erfarna inom flertalet branscher. Vi erbjuder skräddarsydda, kraftfulla och effektiva paketeringar som ger förutsättning för långa samarbeten och goda kundrelationer.</p>\n<p>Våra samarbeten ska i största mån reflektera affärsnytta för kunden.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.25\" background_position=\"top_left\" custom_padding=\"|||\" custom_padding__hover=\"|||\"][et_pb_blurb title=\"tekniska specialister\" url=\"#\" use_icon=\"on\" font_icon=\"%%158%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" admin_label=\"Service 03\" _builder_version=\"4.9.4\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p><span>Vi älskar att ta hand om tekniken! Våra tjänster och konsulter sträcker sig inom många områden, bland annat inom cloud- och IT-infrastruktur. Era tekniska lösningar ska ge den effekt som önskas, genom vårt stöd i förvaltningen eller förändringen.</span></p>\n<p><span>Vi har stöttat flera chefer och beslutsfattare inom IT med vår tekniska kompetens, IT-arkitektur, strategiska val och taktisk planering i befintliga samt nya teknologier och trender.<br /></span></p>\n<p><span>Vanliga uppdrag innefattar bland annat DevOps och continous improvement, microservices, RPA, AI och datadriven services.</span></p>[/et_pb_blurb][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Cloud\" use_icon=\"on\" font_icon=\"%%97%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_blurb title=\"Ledning\" use_icon=\"on\" font_icon=\"%%258%%\" icon_color=\"#887937\" use_icon_font_size=\"on\" icon_font_size=\"60px\" _builder_version=\"4.9.4\" _module_preset=\"default\" header_font=\"Raleway|||on|||||\" header_text_color=\"#FFFFFF\" header_font_size=\"22px\" header_line_height=\"1.8em\" body_font_size=\"16px\" body_line_height=\"1.9em\" background_size=\"initial\" background_position=\"top_left\" background_repeat=\"repeat\" text_orientation=\"center\" background_layout=\"dark\" animation_style=\"fold\" animation_direction=\"bottom\" animation_intensity_fold=\"30%\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>[/et_pb_blurb][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Ou