(234892, 1, '2021-04-28 09:43:10', '2021-04-28 07:43:10', '<label> Namn \r\n    [text your-name] </label>\r\n<label> Mailadress\r\n    [email* your-email] </label>\r\n<label> Telefonnummer\r\n    [tel tel-894] </label>\r\n<label> Välj ärendetyp\r\n[select menu-747 \"Information\" \"Offert\" \"Rekrytering\"] </label>\r\n<label> Meddelande till Great\r\n    [textarea your-message] </label>\r\n\r\n\r\n[submit \"Skicka\"]\n1\nHemsidan - Kontakt \"[your-subject]\"\n[Great hemsida test wordpress] <david@nlsn.nu>\ninfo@greatit.se\nNamn: [your-name] <[your-email]> <[tel-894]>\r\nVad gäller det:[menu-747] \r\n\r\nMeddelande:\r\n[your-message]\r\n\r\n-- \r\nDetta mailet skickas från kontaktformuläret på hemsidan. [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <david@nlsn.nu>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nTack för ditt meddelande. Det har skickats.\nDet var ett fel vid försöket att skicka ditt meddelande. Försök igen senare.\nEtt eller flera fält har ett fel. Kontrollera och försök igen.\nDet var ett fel vid försöket att skicka ditt meddelande. Försök igen senare.\nDu måste acceptera villkoren innan du skickar ditt meddelande.\nFältet är obligatoriskt.\nFältet är för långt.\nFältet är för kort.\nDet var ett okänt fel när filen skulle laddas upp.\nDu saknar behörighet att ladda upp filer av denna typ.\nFilen är för stor.\nDet var ett okänt fel när filen skulle laddas upp.\nDatum-formatet är fel.\nDatumet är före den tidigaste tillåtna.\nDatumet är efter det senast tillåtna.\nTalformatet är ogiltigt.\nTalet är mindre än minsta tillåtna.\nTalet är större än det högsta tillåtna.\nSvaret på quizen är fel.\nE-postadressen är ogiltig.\nURL:en är ogiltig.\nTelefonnumret är ogiltigt.', 'Kontakt', '', 'publish', 'closed', 'closed', '', 'untitled', '', '', '2021-04-28 10:03:39', '2021-04-28 08:03:39', '', 0, 'http://localhost/wordpress/?post_type=wpcf7_contact_form&#038;p=234892', 0, 'wpcf7_contact_form', '', 0);
