konsulter lägger vi stor vikt i partnerskap och nätverk! Lokala, nationella och internationella. Rätt stjärnor i rätt konstellationer är alltid receptet för att nå greatness.</span></p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\" width=\"100%\" max_width=\"100%\" custom_margin=\"|||0px|false|false\"][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_image src=\"http://localhost/wordpress/wp-content/uploads/2021/04/business_01-1024x683.jpg\" title_text=\"business_01\" _builder_version=\"4.9.4\" _module_preset=\"default\"][/et_pb_image][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.9.4\" _module_preset=\"default\"][et_pb_accordion icon_color=\"#887937\" _builder_version=\"4.9.4\" _module_preset=\"default\" toggle_font_size=\"30px\" custom_margin=\"15%|10%|15%|10%|false|false\" box_shadow_style=\"preset2\"][et_pb_accordion_item title=\"Connected Delivery\" open=\"on\" open_toggle_text_color=\"#FFFFFF\" _builder_version=\"4.9.4\" _module_preset=\"default\" body_font=\"Raleway||||||||\" body_text_color=\"#FFFFFF\" body_font_size=\"16px\" body_line_height=\"1.8em\" background_color=\"#31607A\" background_enable_color=\"on\" text_orientation=\"center\" border_color_all=\"#887937\" box_shadow_style=\"preset2\" toggle_level=\"h3\" toggle_font=\"Raleway|600||on|||||\" toggle_font_size=\"30px\" toggle_letter_spacing=\"0px\" toggle_line_height=\"1.4em\"]<p>Ett ramverk som hanterar allt från konsultbehov till att kunna ansluta sig själv eller bolaget man jobbar på.<br /> Vi kommer inom kort även erbjuda denna tjänsten digital med en plattform, till dess når du oss på<span> </span><a href=\"mailto:info@greatit.se\">info@greatit.se</a><br /> Vill du vara med på Great IT med ett härligt gäng kollegor, få vara med och påverka hur framtiden konsultbolag ska se ut, prioritera, föreslå, engagera eller bara helt enkelt 